import React from "react";
import "./App.css";
import Sidenav from "./compo/Sidenav";
import { Route, Routes } from "react-router-dom";
import About from "./compo/About";
import Contact from "./compo/Contact";
import Meditation from "./compo/Meditation";
import NotFound from "./compo/NotFound";
import Profile from "./compo/Profile";
import Services from "./compo/Services";
import Yoga from "./compo/Yoga";
import Hero from "./compo/Hero";
import Course from "./compo/Course";
import Qoute from "./compo/Qoute";
import { Link } from "react-router-dom";
// import Navbar from "./compo/navbar";

function App() {
  return (
    <>
      {/* <Navbar /> */}
      <nav className="navbar">
        <img src="./logo.svg" className="logo" alt="website logo" />
        <ul className="ul">
          <Sidenav />
        </ul>
      </nav>
      <Hero />
      <Qoute />
      <Course />
      <Article />
      <footer>
        <div className="foter">
          <div className="link">
            <h3> Links</h3>
            <Link to="/home">Home</Link>
            <Link to="/services">Services</Link>
            <Link to="/yoga">Yoga</Link>
            <Link to="/about-us">About Us</Link>
            <Link to="/contact">Contact Us</Link>
          </div>
          <div className="class-link">
            <h3> Classes Links</h3>
            <Link to="/notfound">Yoga Class</Link>
            <Link to="/notfound">Meditation Class</Link>
            <Link to="/notfound">Dance Class</Link>
            <Link to="/notfound">Pilate Class</Link>
            <Link to="/notfound">Jumba Class</Link>
          </div>
          <div className="social-link">
            <h3>Fowllow Us</h3>
            <Link to="/notfound">Twitter</Link>
            <Link to="/notfound">Facebook</Link>
            <Link to="/notfound">Instagram</Link>
            <Link to="/notfound">WhatsApp</Link>
            <Link to="/notfound">Youtube</Link>
          </div>
        </div>
        <p className="copyright">Copyright © 2023 KarmShalaYoga.com</p>
      </footer>
      <Routes>
        {/* <Route path="/" element={} /> */}
        <Route path="/profile/" element={<Profile />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/yoga" element={<Yoga />} />
        <Route path="/meditation" element={<Meditation />} />
        <Route path="*" element={<NotFound />} />
        <Route path="notfound" element={<NotFound />} />
        <Route path="/services" element={<Services />} />
        <Route path="/about-us" element={<About />} />
      </Routes>
    </>
  );
}

export default App;
